class Solution:
    def minSubArrayLen(self, target, nums):
        res = float('inf')  # Initialize result to infinity
        left = 0            # Left pointer for the sliding window
        current_sum = 0     # Current sum of the window

        for right in range(len(nums)):
            current_sum += nums[right]  # Expand the window by adding the right element

            # While the current sum is valid (i.e., greater than or equal to target)
            while self.valid(current_sum, target):
                res = min(res, right - left + 1)  # Update the result with the minimal length
                current_sum -= nums[left]          # Shrink the window from the left
                left += 1                          # Move the left pointer to the right

        return 0 if res == float('inf') else res  # Return 0 if no valid subarray found

    def valid(self, current_sum, target):
        return current_sum >= target  # Check

