class Solution:
    def minEatingSpeed(self, piles: List[int], h: int) -> int:
        left, right = 1, max(piles)
        while left < right:
            mid = left + (right - left) // 2
            if self.valid(mid, piles, h):
                right = mid
            else:
                left = mid + 1
        return left

    def valid(self, k, piles, h):
        hours_needed = 0
        for pile in piles:
