class Solution:
    def decodeString(self, s: str) -> str:
        def decodeRe(s):
            nonlocal cur
            content = []
            num = 0
            while cur <= len(s) - 1 and s[cur] != ']':
                if s[cur].isdigit():
                    num = num * 10 + int(s[cur])
                elif s[cur] == '[':
                    cur += 1
                    content.append(num * decodeRe(s))
                    num = 0
                elif s[cur].isalpha():
