class Solution:
    def sumSubarrayMins(self, arr):
        left = [-1] * len(arr)
        right = [len(arr)] * len(arr)
        stack = []
        res = 0

        for i in range(len(arr)):
            while stack and arr[stack[-1]] > arr[i]:
                top = stack.pop()
                right[top] = i
            if stack:
                left[i] = stack[-1]
            stack.append(i)

        for i in range(len(arr)):
            res += arr[i] * (i - left[i]) * (right[i] - i)
        return res % (10**9 + 7)

class UF:
    def __init__(self, n):
        self.parent = [i for i in range(n)]
        self.rank = [0] * n

    def union(self, a, b):
        pa = self.find(a)
        pb = self.find(b)
        if pa != pb:
            if self.rank[pa] > self.rank[pb]:
                self.parent[pb] = pa
            else:
                self.parent[pa] = pb
                if self.rank[pa] == self.rank[pb]:
                    self.rank[pb] += 1

    def find(self, a):
        if self.parent[a] != a:
            self.parent[a] = self.find(self.parent[a])
        return self.parent[a]

class Solution:
    def friendRequests(self, n: int, restrictions, requests):
        uf = UF(n)
        res = []
        for r in requests:
            valid = True
            first = uf.find(r[0])
            second = uf.find(r[1])
            for rest in restrictions:
                third = uf.find(rest[0])
                forth = uf.find(rest[1])
                if set([first, second]) == set([third, forth]):
                    valid = False
                    break
            res.append(valid)
            if valid:
                uf.union(first, second)
        return res

