class Solution:
    def secondMinimum(self, n: int, edges, time: int, change: int) -> int:
        def buildGraph(edges):
            graph = collections.defaultdict(list)
            for e in edges:
                graph[e[0]].append(e[1])
                graph[e[1]].append(e[0])
            return graph

        graph = buildGraph(edges)
        heap = [(0, 1)]
        first = None
        visited = collections.defaultdict(int)
        while heap:
            t, node = heapq.heappop(heap)
            visited[node] += 1
            if node == n:
                if not first:
                    first = t
                elif t > first:
                    return t
            if visited[node] > 2:
                continue
            for e in graph[node]:
                if (t // change) % 2 == 0:
                    heapq.heappush(heap, (t + time, e))
                else:
                    need = change - t % change
                    heapq.heappush(heap, (t + time + need, e))
        return -1

