class Solution:
    def fourSum(self, nums, target: int):
        nums.sort()
        dic = collections.defaultdict(list)
        for i in range(len(nums)):
            for j in range(i+1, len(nums)):
                dic[nums[i]+nums[j]].append((i, j))
        res = []
        visited = set()
        for i in range(len(nums)):
            for j in range(i+1, len(nums)):
                cur = nums[i] + nums[j]
                if target - cur in dic:
                    for s in dic[target-cur]:
                        if set(s) & set([i, j]):
                            continue
                        new_set = sorted([s[0], s[1], i, j])
                        tem = [nums[k] for k in new_set]
                        if tuple(tem) not in visited:
                            visited.add(tuple(tem))
                            res.append(tem)
        return res

