class Solution:
    def longestPalindromeSubseq(self, s: str) -> int:
        dp = [[0] * len(s) for i in range(len(s))]
        def longestPalindromeSub(l, r):
            if l > r:
                return 0
            if l == r:
                dp[l][r] = 1
                return 1
            else:
                if s[l] == s[r]:
                    dp[l][r] = longestPalindromeSub(l+1, r-1) + 2
                else:
                    dp[l][r] = max(longestPalindromeSub(l+1, r), longestPalindromeSub(l, r-1))
            return dp[l][r]
        return longestPalindromeSub(0, len(s)-1)

