class Solution:
    def mctFromLeafValues(self, arr):
        stack = [float('inf')]
        res = 0
        arr = arr + [float('inf')]
        for i in range(len(arr)):
            while stack and stack[-1] < arr[i]:
                top = stack.pop()
                if arr[i] == float('inf') and stack[-1] == float('inf'):
                    break
                else:
                    res += min(stack[-1], arr[i]) * top
            stack.append(arr[i])
        return res

