class Solution:
    def getLengthOfOptimalCompression(self, s: str, k: int) -> int:
        @lru_cache(None)
        def dfs(cur, last, last_count, k):
            if k < 0:
                return float('inf')
            if cur >= len(s):
                return 0

            length = 0
            if s[cur] == last:
                if last_count == 1 or last_count == 9 or last_count == 99:
                    length += 1
                return length + dfs(cur+1, last, last_count+1, k)
            else:
                delete = dfs(cur+1, last, last_count, k-1)
                keep = 1 + dfs(cur+1, s[cur], 1, k)
                return min(delete, keep)
        return dfs(0, '', 0, k)

