class Solution:
    def getLengthOfOptimalCompression(self, s: str, k: int) -> int:
        dp = [[float('inf')] * (len(s)+1) for i in range(k+1)]
        dp[0][0] = 0
        for i in range(k+1):
            for j in range(len(s)+1):
                if j <= i:
                    dp[i][j] = 0
                    continue
                # delete current
                if i > 0:
                    dp[i][j] = dp[i-1][j-1]
                # keep current
                cur = 0
                delete = 0
                dp[i][j] = min(dp[i][j], dp[i][j-1] + 1)
                for v in range(j, 0, -1):
                    if s[v-1] == s[j-1]:
                        cur += 1
                    else:
                        delete += 1
                    if delete <= i:
                        dp[i][j] = min(dp[i][j], dp[i-delete][v-1] + self.cal(cur))
        return dp[-1][-1]

    def cal(self, cur):
        if cur == 0:
            return 0
        if cur == 1:
            return 1
        if cur < 10:
            return 2
        if cur < 100:
            return 3

