        ListNode res = next;
        while (next.next != null) {
            next = next.next;
        }
        next.next = head;
        return res;
    }

    private int getLength(ListNode head) {
        int count = 0;
        while (head != null) {
            count += 1;
            head = head.next;
        }
        return count;
    }
