class Solution {
    public ListNode reverseKGroup(ListNode head, int k) {
        // 1->2->3->4->5
        int count = 1;
        // current = 1
        ListNode current = head;
        // 
        while (count < k && current != null) {
            // count = 2
            count += 1;
            // current = 2
            current = current.next;
        }
        if (count == k && current != null) {
            // pre = 0
            ListNode pre = new ListNode(0);
            // pre.next = reverseGroup(5, 2)
            pre.next = reverseKGroup(current.next, k);
            for (int i=0; i<k; i++) {
                ListNode next = head.next;
                head.next = pre.next;
                pre.next = head;
                head = next;
            }
            return pre.next;
        } else {
            return head;
        }
    }
}

