 *     ListNode(int val, ListNode next) { this.val = val; this.next = next; }
 * }
 */
class Solution {
    public ListNode mergeKLists(ListNode[] lists) {
        int length = lists.length;
        if (length == 0) {
            return null;
        } else if (length == 1) {
            return lists[0];
        }
        ListNode left = mergeKLists(Arrays.copyOfRange(lists,0,length/2));
        ListNode right = mergeKLists(Arrays.copyOfRange(lists,length/2, length));
        return merge(left, right);
    }

    private ListNode merge(ListNode left, ListNode right) {
        ListNode current = new ListNode(0);
        ListNode dummy = current;
        while (left != null || right != null) {
            if (left == null) {
                current.next = right;
                break;
            }
            if (right == null) {
                current.next = left;
                break;
            }
            if (left.val < right.val) {
                current.next = left;
                current = current.next;
                left = left.next;
            } else {
                current.next = right;
                current = current.next;
                right = right.next;
            }
        }
        return dummy.next;
    }
}

