            return Math.max(nums[0], nums[1]);
        } 
        int[] dp = new int[length];
        dp[0] = nums[0];
        dp[1] = Math.max(nums[0], nums[1]);
        for (int i=2; i<length; i++) {
            dp[i] = Math.max(dp[i-1], dp[i-2] + nums[i]);
        }
        return dp[length-1];
    }
}

class Solution:
    def mergeStones(self, stones: List[int], K: int) -> int:
        length = len(stones)
        if length == 1:
            return 0
        if (length-1) % (K-1) != 0:
            return -1
        return self.recursion(stones, K)

    def recursion(self, stones, K):
        length = len(stones)
        if length == K:
            return sum(stones)
        if (length-1) % (K-1) != 0:
            return float('inf')        
        res = float('inf')
        for i in range(length-K+1):
            current_sum = sum(stones[i:i+K])
            res = min(res, self.recursion(stones[:i] + [current_sum] + stones[i+K:], K) + current_sum)
        return res

