class Solution:
    def mergeStones(self, stones: List[int], K: int) -> int:
        # [3,2,4,1]
        # 2
        # 4
        L = len(stones)
        if L == 1:
            return 0
        elif K == L:
            return sum(stones)
        elif K > L or not self.valid(L, K):
            return -1
        self.dic = dict()
        return self.recursion(stones, K, 0)

    def recursion(self, stones, K, cost):
        if tuple(stones) in self.dic:
            return self.dic[tuple(stones)]
        # 4
        L = len(stones)
        if L == 1:
            return cost
        res = float('inf')
        # i = [0, 2]
        for i in range(L-K+1):
            current_sum = sum(stones[i:i+K])
            res = min(
                res, self.recursion(stones[:i] + [current_sum] + stones[i+K:], K, cost + current_sum))
        self.dic[tuple(stones)] = res
        return res

    def valid(self, L, K):
        while L != 1:
            L -= K
            if L < 0:
                return False
            L += 1
        return True

import math
from math import log2

class Solution:
    def racecar(self, target: int) -> int:
        self.base_case(10000)
        return self.recursion(target)

    def base_case(self, maximum):
        self.dic = dict()
        max_bit_length = math.floor(log2(maximum)) + 1
        for i in range(max_bit_length+1):
            # 0 -> 0
            # 1 -> 1
            self.dic[2**i-1] = i

    def recursion(self, target):
        if target in self.dic:
            return self.dic[target]
        n = math.floor(log2(target)) + 1
        # n = 3
        # 3 + 1
        res = n + 1 + self.recursion(2**n-1-target)
        # m = [0, 2]
        for m in range(n-1):
            if m + n + 1 < res:
                res = min(res, n + m + 1 + self.recursion(target+2**m-2**(n-1)))
        self.dic[target] = res
        return res
